import React from 'react'
import databiz from "../Images/client-databiz.svg"
import audio from "../Images/client-audiophile.svg"

const Footer = () => {
  return (
    <div className='d-flex' >
     <img src={databiz} alt=''/>
     <img src={audio} alt=''/>

    </div>
  )
}

export default Footer
